<?php
session_start();
require_once "config.php"; // Sertakan file konfigurasi koneksi ke database

// Cek apakah pengguna sudah login
if (isset($_SESSION['username'])) {
    if ($_SESSION['is_admin']) {
        header('Location: ../dashboard/index.php');
    } else {
        header('Location: home.php');
    }
    exit;
}

// Proses form jika ada pengiriman data POST
if ($_SERVER['REQUEST_METHOD'] === 'POST') {
    // Ambil nilai yang dikirimkan dari form
    $username = $_POST['username'];
    $password = $_POST['password'];

    // Query untuk memeriksa kredensial pengguna
    $sql = "SELECT id, username, password, is_admin FROM users WHERE username = ?";
    $stmt = mysqli_prepare($koneksi, $sql);

    if ($stmt) {
        // Bind parameter ke statement SQL
        mysqli_stmt_bind_param($stmt, "s", $username);

        // Eksekusi statement
        mysqli_stmt_execute($stmt);

        // Ambil hasil query
        mysqli_stmt_store_result($stmt);

        // Bind hasil query ke variabel
        mysqli_stmt_bind_result($stmt, $id, $username, $hashed_password, $is_admin);

        // Periksa apakah username ditemukan
        if (mysqli_stmt_num_rows($stmt) == 1) {
            // Fetch hasil query
            mysqli_stmt_fetch($stmt);

            // Verifikasi password
            if (password_verify($password, $hashed_password)) {
                // Password benar, atur session
                $_SESSION['username'] = $username;
                $_SESSION['id'] = $id;
                $_SESSION['is_admin'] = $is_admin;

                // Redirect berdasarkan peran pengguna
                if ($is_admin) {
                    header('Location: ../dashboard/index.php');
                } else {
                    header('Location: home.php');
                }
                exit;
            } else {
                // Password salah
                $error = "Username or password is incorrect";
            }
        } else {
            // Username tidak ditemukan
            $error = "Username or password is incorrect";
        }

        mysqli_stmt_close($stmt);
    } else {
        $error = "Database error: could not prepare statement";
    }
}
?>

